import styles from './bookRating.module.scss'
import store from 'store'
import { RatingStructure } from 'types/searchStructure'

const BookRating = () => {
  const ratingData = store.get('ratingStore')

  return (
    <div className={styles.bookRating}>
      <ul>
        {ratingData.map((item: RatingStructure) => (
          <li key={item.isbn}>
            <img className={styles.bookImg} src={item.thumbnail} alt={`${item.title}_img`} />
            <p>{item.title}</p>
            <div>평가함 별{item.star}</div>
          </li>
        ))}
      </ul>
    </div>
  )
}

export default BookRating
